('007570cb414146afbc386a5dcd16e7b7', '3b8df1fdb72b40ada65626b72b968cae', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 103, 'Siêu thị thông minh: chỉ dẫn mua sắm dựa vào xác định vị trí bằng wifi', 'Smart shopping: navigation for shopping based on wifi positioning', 1, 'Hướng dẫn người dùng mua sắm ở siêu thị một cách tiện lợi và nhanh chóng nhất.', '', NULL, NULL, NULL, 'e6828068a622452aa3e4b51120f0b378', NULL, NULL, 'e6828068a622452aa3e4b51120f0b378', NULL, NULL, NULL, '2017-10-24 03:12:33', '0000-00-00 00:00:00', 3),
('017b13a6f149429c9dd03544c336c1fd', '307ed64dce764b5d8d325402a20b8646', 'bebe3f425eb0467586f34834ad4bd17c', 1, 103, 'Công cụ kiểm định phần mềm (software verification): Mercury Quality Center', '', 0, 'Mercury Quality Center (MQC) là một công cụ quản lý cung cấp sự kiểm soát tập trung trên toàn bộ dự án. MQC được sử dụng bởi các kiểm thử viên cũng như người quản lí. Nó cung cấp giao diện dễ dàng để quản lý và tổ chức các hoạt động như bao phủ yêu cầu, quản lý các ca kiểm thử, báo cáo chi tiết sau khi thực hiện các ca kiểm thử, quản lý lỗi và kiểm thử tự động.', '', NULL, NULL, NULL, 'ab16d5f753f24b01bb9abc2089436c63', NULL, NULL, 'ab16d5f753f24b01bb9abc2089436c63', NULL, NULL, NULL, '2017-10-24 03:12:36', '0000-00-00 00:00:00', 3),
('02dc6ba7d4664be8be141799d0016894', 'fd1c42ab68334a5bae4b96d2f66c4c3f', 'bebe3f425eb0467586f34834ad4bd17c', 1, 103, 'XÂY DỰNG ỨNG DỤNG HỖ TRỢ TUYỂN DỤNG VÀ TÌM VIỆC LÀM TRÊN ANDROID', '', 0, 'Ứng dụng hỗ trợ tuyển dụng và tìm việc làm trên Android là hai ứng dụng tách biêt, 1 ứng dụng giành cho nhà tuyển dụng đăng việc và tìm người (ứng viên), 1 ứng dụng giành cho ứng viên tìm việc làm mình mong muốn. Mục tiêu của sản phẩm: trở thành sản phẩm cung cấp dịch vụ tìm việc, tìm ứng viên nhanh, hiệu quả và đáng tin cạy nhất.', '', NULL, NULL, NULL, 'ce1aac305d5048d2a09b3ce62763fb56', NULL, NULL, 'ce1aac305d5048d2a09b3ce62763fb56', NULL, NULL, NULL, '2017-10-24 03:12:35', '0000-00-00 00:00:00', 3),
