('1bb002b4b224416f96e5b662cfd4a6cf', '0c577a527ed8475cbe8f139f608ce8f2', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 888, 'Xây dựng hệ thống giám sát, cảnh báo cho máy chủ web', '', 0, '- Cài đặt và đánh giá hệ thống xử lý, phân tích dữ liệu nhật ký (log) bằng giải pháp ELK (Elasticsearch, Logstash, Kibana) trên hê điều hành nhân Linux. (Ubuntu, CentOS). Áp dụng phân tích dữ liệu nhật ký của máy chủ web.\n- Tích hợp thêm giải pháp Kafka -Zookeeper để xử lý tiếp nhận dữ liệu lớn từ nhiều nguồn\n- Cài đặt giải pháp mã nguồn mở ElastAlert để theo dõi và cảnh báo dựa trên dữ liệu của Elasticsearch.\n- Cài đặt dịch vụ check_mk để giám sát và cảnh báo phần cứng và các dịch vụ trên máy chủ web.', 'ELK, Elasticsearch', NULL, NULL, NULL, 'ada72c1fa3e648679bcaf464cef8e2b0', '5a6ab1dc47cf48f49f80316f697873ee', NULL, 'ada72c1fa3e648679bcaf464cef8e2b0', '2017-08-07 00:00:00', '2017-12-20 09:27:26', '2017-12-20 09:27:26', '2017-05-08 04:49:27', '0000-00-00 00:00:00', 2),
