('1d8c316a984c44ccbbbd4f6ed639c031', '2712f2a1b38b45b79820bb28b0474d5a', 'e73123fc886e4583bd535843b19aeb3f', 2, 888, 'Phân tích tensor nhanh trong việc phát hiện sự bất thường', '', 0, 'Phân tích tensor nhanh trong việc phát hiện sự bất thường', '', NULL, '/uploads/dangki/luanvan/2017/le_hoang_anh.pdf', NULL, 'a9555c02f00048e6adddcf43723d20e1', NULL, NULL, 'a9555c02f00048e6adddcf43723d20e1', '2017-06-16 10:44:47', '2019-11-18 10:44:47', '2019-11-18 10:44:47', '2017-09-15 09:54:13', '0000-00-00 00:00:00', 1),
('1df83fab973e48f7b5e542ff366fbe46', '9a887894beae4fa58b67cd30ab4281eb', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 103, 'Xây dựng thuật toán điều khiển hệ thống chiếu sáng thông minh', '', 0, 'Với sự phát triển mạnh mẽ của khoa học công nghệ hiện nay, mô hình nhà thông minh đang ngày càng trở nên phổ biến. Một trong những thành phần quan trọng trong mỗi ngôi nhà thông minh chính là hệ thống chiếu sáng. Các hệ thống chiếu sáng thông minh trên thị trường có cơ chế điều khiển khá đơn giản, chủ yếu dựa trên sự có mặt của người dùng trong phòng. Vì vậy nên việc điều khiển của những hệ thống này còn nhiều hạn chế và chưa thực sự tối ưu. Khóa luận tốt nghiệp này sẽ xây dựng thuật toán điều khiển chiếu sáng “thông minh” hơn dựa trên sự phân bố của ánh sáng môi trường trong căn phòng vào ban ngày, sử dụng camera và cảm biến ánh sáng để lấy giá trị cường độ ánh sáng một cách chính xác nhất. Hệ thống sẽ sử dụng hai giao thức truyền dữ liệu là Echonet Lite và MQTT, và có khả năng tích hợp với vào một mô hình nhà thông minh có sử dụng hai giao thức trên', 'IOT', NULL, NULL, NULL, 'e6828068a622452aa3e4b51120f0b378', NULL, NULL, 'e6828068a622452aa3e4b51120f0b378', NULL, NULL, NULL, '2017-10-24 03:12:39', '0000-00-00 00:00:00', 3),
