('39fdbc4f77624c3ea63da832dd7acd9c', '1a33317fdefc4e2b8bc52dcd1bdb9b94', 'e73123fc886e4583bd535843b19aeb3f', 1, 103, 'Xây dựng hệ thống chat trực tiếp cho dịch vụ tư vấn bác sỹ của Bibabo', '', 0, 'Đề tài được gắn với công ty Bibabo - là một công ty chuyên về những sản phẩm mẹ và bé. Nhiều bà mẹ muốn ở nhà và được bác sĩ tư vấn trong quá trình mang thai có thể sử dụng để chat trực tiếp với bác sĩ giúp cho việc tư vấn giữa bác sĩ với bệnh nhân trở nên dễ dàng hơn. Bệnh nhân có thể ở nhà và gửi ảnh cũng như gửi biểu hiện bệnh của mình đến cho bác sĩ tư vấn về bệnh của mình.', '', NULL, NULL, NULL, '632ad8ef939b425eb620b3903f10200a', NULL, NULL, '632ad8ef939b425eb620b3903f10200a', NULL, NULL, NULL, '2017-10-24 03:12:38', '0000-00-00 00:00:00', 3),
