('3ae6289865d04940b235ced4ccb1c7e8', 'b74f3bacb4f342bcb9fced369632dfd7', 'bebe3f425eb0467586f34834ad4bd17c', 1, 103, 'Xử lý tên riêng trong dịch máy Nhật-Việt', '', 0, 'Dịch tự động Nhật - Việt là một bài toán nghiên cứu mới và có ý nghĩa ứng dụng cao. Cặp ngôn ngữ này có nhiều khác biệt về trật tự từ, hình thái,... trong đó khác biệt về tên riêng cũng là một thách thức cho dịch máy. Khóa luận tập trung vào vấn đề xử lý tên riêng trong dịch máy dựa vào kho ngữ liệu và các đặc trưng ngôn ngữ học. Kết quả xử lý tên riêng tích hợp trong dịch máy sẽ được đánh giá qua phân tích kết quả dịch theo một trong hai tiếp cận thống kê hoặc mạng nơ-ron.', '', NULL, NULL, NULL, '3a8ef5dc78694e9abe83ae0221debc90', NULL, NULL, '3a8ef5dc78694e9abe83ae0221debc90', NULL, NULL, NULL, '2017-10-24 03:12:37', '0000-00-00 00:00:00', 3),
