('40a353c1e6c349a8a6a8b2ce0add2bf8', '8f8f2bc066f84dfb8d343d95a4ccc0d8', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Tìm hiểu về SOFL và vận dụng để phát triển hệ thống đăng kí môn học', '', 0, 'Khóa luận sẽ trình bày hướng phát triển hệ thống mới là SOFL viết tắt của Structured Object-Oriented Formal Language. SOFL là sự kết hợp của phương pháp hướng đối tượng, hướng cấu trúc và ngôn ngữ hình thức. Đồng thời khóa luận sẽ trình bày các bước xây dựng một hệ thống, cụ thể là hệ thống đăng kí môn học theo phương pháp này.', '', NULL, NULL, NULL, '0cb2b903a4fa4e3aa2af8789284bb889', NULL, NULL, '0cb2b903a4fa4e3aa2af8789284bb889', NULL, NULL, NULL, '2017-10-24 03:12:38', '0000-00-00 00:00:00', 3),
