('4569729cd3fc4e44a9dacdc5d7c88aac', 'd72436561f07482481312b150ecdd82e', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 103, 'Siêu thị thông minh: Xác định vị trí người mua hàng tại siêu thị dựa trên các công nghệ định vị trong nhà - Wifi, Bluetooth và Visible light communication', 'Smart shopping: Identify customer location in marketplace based on indoor positioning technologies - Wifi, Bluetooth and Visible light communication', 1, 'Việc xác định được vị trí của người mua hàng trong siêu thị là rất quan trọng trong chủ đề về siêu thị thông minh, từ thông tin về vị trí hiện tại của người mua hàng, ta có thể tiếp tục sử dụng chúng để giúp chỉ đường hay đưa ra các thông tin hữu ích cho người mua hàng trong siêu thị.', 'Iot', NULL, NULL, NULL, 'e6828068a622452aa3e4b51120f0b378', NULL, NULL, 'e6828068a622452aa3e4b51120f0b378', NULL, NULL, NULL, '2017-10-24 03:12:33', '0000-00-00 00:00:00', 3),
('462ada364c42480eaa6be114c89a8116', '36bb73f7b2154ce18249e181f0d80967', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 103, 'Phát triển các dịch vụ phía người dùng doanh nghiệp cho hệ thống email marketing', '', 0, 'Phát triển các dịch vụ phía người dùng doanh nghiệp cho hệ thống email marketing', '', NULL, NULL, NULL, 'f2ee7e73cb2e436ea12f31d86626fe43', '001f823cce85434abbc4c1beac995f30', NULL, 'f2ee7e73cb2e436ea12f31d86626fe43', NULL, NULL, NULL, '2017-10-24 03:12:34', '0000-00-00 00:00:00', 3),
('46d592526214456081f8ea55b20e156e', 'f1c1a540db8a43689bcd218769fbf06f', '6c35b36d0ed84ea48476d6b0a03d4fa0', 1, 103, 'Achterbahn-128/80', 'Achterbahn-128/80', 1, 'In cryptography, Achterbahn is the name of a synchronous stream cipher algorithm submitted to the eSTREAM Project of the eCRYPT network. In the final specification the cipher is called ACHTERBAHN-128/80, because it supports the key lengths of 80 bits and 128 bits, respectively. Achterbahn was developed by Berndt Gammel, Rainer Göttfert and Oliver Kniffler. Achterbahn means rollercoaster (in German), though a literal translation of the term would be eight-track, which indicates that the cipher can encrypt eight bit streams in parallel. ACHTERBAHN-128 is downward compatible and can produce the same keystream as ACHTERBAHN-80 if so desired. The keystream generator of ACHTERBAHN-128/80 is based on the design principle of the nonlinear combination generator, however it deploys primitive nonlinear feedback shift registers (NLFSR) instead of linear ones (LFSR).', '', NULL, NULL, NULL, '2b7272f6bad5404d879e37d9a3a265b9', NULL, NULL, '2b7272f6bad5404d879e37d9a3a265b9', NULL, NULL, NULL, '2017-10-24 03:12:32', '0000-00-00 00:00:00', 3),
('480882708d67401b90ea3de3b960baa4', 'daf3a61156c8499094d0930f6bf0dc97', 'baee3b743d9f4581b015aa3b202f3eae', 1, 103, 'Hệ thống nhận diện ngày tháng trong hội thoại', '', 0, 'Hiện nay, phần nhận dạng thời gian tiếng Việt thuộc các dạng không viết theo chuẩn Tiếng Việt kết quả chưa được tốt, đặc biệt khi ứng dụng trong các đoạn chat hội thoại mà người dùng cuối sử dụng ngôn ngữ không theo chuẩn hoặc viết thời gian không theo thứ tự hoặc có thể nhầm với các thực thể khác thì các hệ bắt dùng luật sẽ nhận diện nhầm hoặc không nhận diện được. Vậy nên việc bắt các dạng thời gian này hiện còn chưa được giải quyết triệt để, có rất nhiều khó khăn. Vì vậy cần xây dựng một hệ thống có thể nhận diện thời gian một cách tốt nhất và có thể ứng cho các đoạn hội thoại trả lời tự động tốt hơn.', 'Học máy', NULL, NULL, NULL, '2721cbe23b8e42c596a389d0e18ff8eb', '47860b8fe9cc42e897a413f04dda8fb7', NULL, '2721cbe23b8e42c596a389d0e18ff8eb', NULL, NULL, NULL, '2017-10-24 03:12:35', '0000-00-00 00:00:00', 3),
('4a72f348bc5f441dacaf781baa95b655', 'a61e9b45f71a49b3aaec24f5e70dd3cd', '6c35b36d0ed84ea48476d6b0a03d4fa0', 1, 103, 'Dự đoán vị trí trên chuỗi DNA gắn với tác nhân điều khiển phiên mã sử dụng kỹ thuật học sâu', '', 0, 'Biết được các đặc trưng của chuỗi DNA là điều cần thiết để phát triển mô hình kiểm soát trong các hệ thống sinh học và xác định biến thể của các bệnh nhân. Các đặc trưng trình của tự có thể được xác định chắc chắn từ dữ liệu thực nghiệm với các kỹ thuật \"học sâu\" cung cấp phương pháp tính toán linh hoạt, linh hoạt và thống nhất cho việc khám phá mẫu.', 'Tin sinh học', NULL, NULL, NULL, '3470f24e13a34279918a11adc57b46af', NULL, NULL, '3470f24e13a34279918a11adc57b46af', NULL, NULL, NULL, '2017-10-24 03:12:34', '0000-00-00 00:00:00', 3),
