('4ab01e14f2d74ee5bc4c8a631aa9e2a2', '3cda197712fc421cada0c301e05883c3', 'e73123fc886e4583bd535843b19aeb3f', 1, 103, 'Nghiên cứu mô hình Cơ sở Dữ Liệu NewSql Google F1', '', 0, 'Tìm hiểu mô hình Google F1\nPhân tích điểm mạnh điểm yếu so với hệ quản trị cơ sở dữ liệu truyền thống\nHiểu được tính phân tán, hiểu được vì sao mô hình thỏa mãn tính ACID mà vẫn thực thi với tốc độ rất nhanh.', '', NULL, NULL, NULL, 'b8d108ccbfde43819d0aa95d1b35f961', NULL, NULL, 'b8d108ccbfde43819d0aa95d1b35f961', NULL, NULL, NULL, '2017-10-24 03:12:37', '0000-00-00 00:00:00', 3),
