('4b451908c22140799ae0d1e5c9ebf177', '6b697fd9db8140b082292a6c38c3babc', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Nghiên cứu và ứng dụng công nghệ bản đồ số sử dụng chiều thời gian trong thực tiễn', '', 0, 'Công nghệ bản đồ số là loại bản đồ ảo trên máy tính được dựng lên dựa trên dữ liệu chính xác thu thập được từ nhiều nguồn. Bản đồ số phổ biến hiện tại chỉ thể hiện được ở chiều không gian và trong khóa luận này, công nghệ bản đồ số sẽ có thể hiển thị được trên cả chiều thời gian. Như vậy có nghĩa là ta có thể xem các dữ liệu đã thu thập được trong quá khứ được biểu diễn trên bản đồ số và các dự báo về sự thay đổi của dữ liệu trong tương lai. Khóa luận này sẽ tập trung vào các vấn đề chính là sự thay đổi của địa giới hành chính, sự thay đổi dân cư trong quá khứ và dự báo cho tương lai.', '', NULL, NULL, NULL, '17c00d2b89664991931440a257a571c6', 'e123c8ff99724fe08401c06807aefb38', NULL, '17c00d2b89664991931440a257a571c6', NULL, NULL, NULL, '2017-10-24 03:12:35', '0000-00-00 00:00:00', 3),
