('4ec858367571487fac685c0ce0b84d05', '71769c8e05434b0e8926186738ae3254', '359070d50a3f4201be26fbba6e7cdba5', 1, 888, 'Nghiên cứu cải tiến giao thức định tuyến AODV cho mạng MANETs', '', 0, 'Gần đây, định tuyến trong mạng MANETs được quan tâm rất nhiều. Việc nghiên cứu các giải pháp tối ưu để nâng cao hiệu quả hoạt động của các giao thức định tuyến là rất cần thiết. Khi đó các giao thức định tuyến như AODV, DSR, DSDV đã được triển khai nghiên cứu từ trước đây. Dựa vào kết quả đó ta đề xuất cải tiến để nâng cao hiệu quả hoạt động các giao thức này.', 'Định tuyến MANET, AODV,...', NULL, NULL, NULL, '188717cfb796430fbc7f058bd8d32a66', NULL, NULL, '188717cfb796430fbc7f058bd8d32a66', '2017-08-07 00:00:00', '2017-12-20 09:27:26', '2017-12-20 09:27:26', '2017-05-08 04:49:27', '0000-00-00 00:00:00', 2),
