('51a6b2bb54064d8a8aaa5ee831cb4fc3', 'cb6cd126e5d14751a538e1e05bba671a', 'e73123fc886e4583bd535843b19aeb3f', 1, 103, 'Nghiên cứu an ninh các ứng dụng web trên máy chủ', '', 0, 'Tìm hiểu an ninh ứng dụng web phía máy chủ: SQL injection, các kỹ thuật\ntấn công CSDL, tấn công qua upload file...\nTriển khai một ứng dụng web thử nghiệm (ví dụ Magento), sử dụng các\nversion cũ để thử nghiệm ccs lỗi an ninh do cộng đồng đã phát hiện ra.', '', NULL, NULL, NULL, 'f359d785ce704c30bb7f35eba8354c24', NULL, NULL, 'f359d785ce704c30bb7f35eba8354c24', NULL, NULL, NULL, '2017-10-24 03:12:39', '0000-00-00 00:00:00', 3),
('52229a8ac3564029aa60886be215b4b3', 'f58a3f36b1a24daf9657f12426808b91', '61b24570d22f4f85a9bfb4e38ff866dc', 1, 103, 'Tích hợp ảnh vệ tinh đa nguồn cho bài toán giám sát chất lượng không khí trên lãnh thổ Việt Nam', '', 0, 'Với sự sẵn có (ngày càng tăng) của dữ liệu viễn thám trái đất từ các cảm biến vệ tinh, nhiều trong số chúng có thể bổ sung cho nhau, điều này cho thấy có nhiều khả năng kết hợp dữ liệu một cách tối ưu thông qua các kỹ thuật data merging hoặc data fusion. Chúng ta có thể lấy được một bản đồ hoàn chỉnh giá trị tham số địa vật lý(ví dụ AOT) trong 1 khu vực hay toàn cầu, từ đó dùng cho việc so sánh hoặc là đầu vào cho các mô hình 3-D quy mô khu vực(toàn cầu). Thông thường, thông tin cung cấp bởi một sensor sẽ không hoàn chỉnh về mặt không gian, hoặc tự nó không đủ dữ liệu để tạo ra các bản đồ toàn cầu(khu vực) hàng ngày.Trong những trương hợp như vậy, việc trộn các dữ liệu đồng vị trí thu được từ các cảm biến giống nhau hoặc tương tự, sau đó sử dụng nội suy để điền lấp các chỗ trống dữ liệu, có thể tạo ra một bản đồ khu vực(toàn cầu) hoàn chỉnh, nhất quán, đáng tin cậy.', '', NULL, NULL, NULL, 'dfd8b80a952d4c149149f36fb1b19583', 'ce95ee8cedbb46e9b99d0fd637e4eb06', NULL, 'dfd8b80a952d4c149149f36fb1b19583', NULL, NULL, NULL, '2017-10-24 03:12:40', '0000-00-00 00:00:00', 3),
