('680d82ad724447598419f9217dfe6110', '696e1cc7e5974f368bb88e65f78026ad', 'ee19a8616e6a468f8f727fb5be89f20b', 2, 888, 'Định tuyến động QoS trong hội nghị truyền hình trên SDN', '', 0, 'Định tuyến động QoS trong hội nghị truyền hình trên SDN', '', NULL, '/uploads/dangki/luanvan/2017/dam_van_hai.pdf', NULL, '7c3955967abb44c4b7ed3136aeb8293b', NULL, NULL, '7c3955967abb44c4b7ed3136aeb8293b', '2017-06-16 10:33:04', '2019-11-18 10:33:04', '2019-11-18 10:33:04', '2017-09-15 09:54:14', '0000-00-00 00:00:00', 1),
('68453b12cf1648fc84f454e8f9230f76', '0442718484ec4cb49cfa57573a9d6aa6', 'baee3b743d9f4581b015aa3b202f3eae', 1, 103, 'Mô hình hóa chủ đề suốt đời và ứng dụng vào phân lớp đa nhãn văn bản tiếng Việt', '', 0, 'Mục đích chính của khóa luận này là nghiên cứu về phương pháp học suốt đời qua đó đề xuất mô hình phân lớp đa nhãn dựa trên phân cụm bán giám sát khai thác tri thức must-links, cannot-links.\nHọc máy suốt đời (Lifelong Machine Learning) hay Học suốt đời (Lifelong Learning) là một mô hình học máy tiên tiến, học một cách liên tục, tích lũy tri thức học được qua các nhiệm vụ học trước và sử dụng tri thức đó để hỗ trợ học trong tương lai. Trong quá trình đó, bộ học trở nên ngày càng am hiểu và hiệu quả trong việc học. Khả năng học như vậy là một trong những dấu hiệu của trí thông minh của con người. So với mô hình học cô lập - một mô hình học lãng phí do không cố gắng giữ lại tri thức đã học và sử dụng tri thức đó vào các hoạt động trong tương lai, thì mô hình học suốt đời đã có thể khắc phục được nhược điểm trên.\nMột vài thực nghiệm trên miền dữ liệu tiếng Việt được thực hiện để đánh giá kết quả phân lớp đa nhãn của mô hình đề xuất.', '', NULL, NULL, NULL, '77de2c69fca4437490cd433b846eeffe', NULL, NULL, '77de2c69fca4437490cd433b846eeffe', NULL, NULL, NULL, '2017-10-24 03:12:40', '0000-00-00 00:00:00', 3),
