('6a26e565344c45e1b2607fe4c03304e7', 'fa00f9bc29474bcfa3663359a37c3d29', 'baee3b743d9f4581b015aa3b202f3eae', 1, 103, 'Mô hình hội thoại dựa trên kỹ thuật học sâu Sequence to sequence', '', 0, 'Bài toán xây dựng mô hình hội thoại với đầu vào là một câu hội thoại và đầu ra là câu trả lời tương ứng, dựa trên kỹ thuật học sâu Seq2seq học các cặp trao đổi được lấy từ các cuộc hội thoại trên mạng xã hội.', '', NULL, NULL, NULL, '77de2c69fca4437490cd433b846eeffe', '27b9405bcbb04f018fdf1b5acd39b7a7', NULL, '77de2c69fca4437490cd433b846eeffe', NULL, NULL, NULL, '2017-10-24 03:12:34', '0000-00-00 00:00:00', 3),
('6a6da7eb0a254c02a680eeb8c8c5bb6a', 'da19da35ff9e4c02be31e941495eba9a', 'f325ef87ee92442bb17353d9fdf6124a', 1, 103, 'Hệ thống đi chung xe cho nhu cầu đi lại của sinh viên', '', 0, 'Hệ thống cho phép sinh viên có xe đạp hoặc xe máy đăng ký để đi chung với những người không có xe và vì thế sẽ giảm chi phí đi lại và sự tiện lợi cho cả đối bên. Hệ thống hỗ trợ tìm kiếm căp đôi thỏa mãn điều kiện ràng buộc thời gian đón, thả, và quãng đường tăng thêm của người có xe là thấp nhất ', '', NULL, NULL, NULL, '63aa694de6c24a68ba3a8679c1817a45', NULL, NULL, '63aa694de6c24a68ba3a8679c1817a45', NULL, NULL, NULL, '2017-10-24 03:12:36', '0000-00-00 00:00:00', 3),
