('72b91e482b0749a8810beb3258566b85', 'f92c41747cf64ef69e628e9ad8480cf8', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Ứng dụng công nghệ chuỗi khối để quản lý tiền ảo của Sách Mềm.', '', 0, 'Sử dụng Etherium để quản lý tiền ảo của người dùng, cho phép người dùng sử dụng tiền ảo để sử dụng các dịch vụ của Sách Mềm', '', NULL, NULL, NULL, '928a95032edc422db1985d70c6eed91a', '1fe71f2e657e470b8d4666e71ba9fdb9', NULL, '928a95032edc422db1985d70c6eed91a', NULL, NULL, NULL, '2017-10-24 03:12:37', '0000-00-00 00:00:00', 3),
('730b8020ea4f4c78a29d2a006dd0fa44', 'cebd1adc4db143e6b84eaf4656a53ddc', 'bebe3f425eb0467586f34834ad4bd17c', 1, 103, 'Phân vùng ảnh theo ngữ nghĩa trong video', 'Semantic segmentation in video sequences', 1, 'In recent years, there has been powerful progress in image semantic segmentation using deep learning techniques, however, almost all these state-of-the-art algorithms only utilize spatial domain and ignore the time domain in video sequences. In my thesis, i propose a deep learning technique using temporal continuity inherent in video to speed up semantic segmentation process in video.', '', NULL, NULL, NULL, '47860b8fe9cc42e897a413f04dda8fb7', '084b9c979d434d45bdcc73a427d7ebfd', NULL, '47860b8fe9cc42e897a413f04dda8fb7', NULL, NULL, NULL, '2017-10-24 03:12:33', '0000-00-00 00:00:00', 3),
('734d3afc59cf4f329bcc3591b880ed1c', '22fdfe60b5e94a58b3c1aa329ad11366', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Xây dựng kiến trúc cho các ứng dụng doanh nghiệp dựa trên phân tích mã nguồn', '', 0, 'Hiện nay, các ứng dụng của doanh nghiệp đang thiếu thiết kế hệ thống và kiến trúc hệ thống, điều này dẫn đến khó khăn trong quá trình bảo trì và nâng cấp. Khóa luận này nhằm mục đích giúp xây dựng lên kiến trúc hệ thống với sự trực quan hóa ở nhiều góc độ khác nhau dựa trên việc phân tích mã nguồn. Điều này giúp hoàn thiện tài liệu hệ thống và  mọi người có sự hiểu biết tổng quát về hệ thống.', '', NULL, NULL, NULL, '8d2754fe281648619a6b02d5327fb4d4', NULL, NULL, '8d2754fe281648619a6b02d5327fb4d4', NULL, NULL, NULL, '2017-10-24 03:12:34', '0000-00-00 00:00:00', 3),
('73aae889c795428ebdb8e3e96b3888e5', 'ab4e20bd406e4c2780a91ff0d368625d', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Phân tích, thiết kế và xây dựng hệ thống theo dõi, giám sát hành trình các phương tiện vận tải', '', 0, '- Hệ thống cho phép theo dõi, giám sát hành trình của các phương tiện vận tải\n- Ngôn ngữ: php, extendjs', '', NULL, NULL, NULL, '37a549a3f29b4515b5529e24f8d08b24', NULL, NULL, '37a549a3f29b4515b5529e24f8d08b24', NULL, NULL, NULL, '2017-10-24 03:12:37', '0000-00-00 00:00:00', 3),
('751a0f562f0644e3bb80e9a5694f3444', '4fead7fca7a94fe7a3199db7fde1858c', 'f325ef87ee92442bb17353d9fdf6124a', 1, 103, 'Xây dựng hệ thống Fitness - Giải pháp cho người tập fitness và phòng tập', '', 0, 'Xây dựng một mạng xã hội thu nhỏ dành cho những người tập fitness có thể trao đổi kinh nghiệm tập luyện, tìm kiếm các phòng tập theo ý muốn và mua các sản phẩm hỗ trợ phục vụ cho việc tập luyện. Đồng thời cũng là giải pháp để người dùng và phòng tập kết nối với nhau một cách thông minh và hiệu quả hơn so với phương pháp cấp phát thẻ Hội viên phòng tập theo truyền thống.', '', NULL, NULL, NULL, '63aa694de6c24a68ba3a8679c1817a45', NULL, NULL, '63aa694de6c24a68ba3a8679c1817a45', NULL, NULL, NULL, '2017-10-24 03:12:39', '0000-00-00 00:00:00', 3),
('75d601024d5f4d1fa7ea4ba042639237', 'd0953aec7c164bf8938ab72f08c3a7cd', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Tìm hiểu và vận dụng kỹ thuật tóm tắt đa văn bản cho ứng dụng tổng hợp tin tức từ các trang báo điện tử', '', 0, 'Tìm hiểu và vận dụng kỹ thuật tóm tắt đa văn bản cho ứng dụng tổng hợp tin tức từ các trang báo điện tử. Xây dựng 1 ứng dụng dùng ngôn ngữ Java và các công cụ crawler trong Java.', 'Xử lý ngôn ngữ tự nhiên', NULL, NULL, NULL, '25e2711f30fa4e3c99436703bac2b694', NULL, NULL, '25e2711f30fa4e3c99436703bac2b694', NULL, NULL, NULL, '2017-10-24 03:12:34', '0000-00-00 00:00:00', 3),
('7665a1c4d304421eb054eafd9815b8c2', '3c0cf39a73d24bc385ee921799f76530', 'e73123fc886e4583bd535843b19aeb3f', 1, 103, 'Phát triển dịch vụ quản lý du lịch trực tuyến trên nền Web', '', 0, 'Phát triển dịch vụ quản lý du lịch nhằm giúp người du lịch biết thông tin địa điểm du lịch quanh khu vực của mình và gợi ý cho người du lịch các điểm du lịch phù hợp với yêu cầu', '', NULL, NULL, NULL, '6c49968c338a478e8a38af877ab58773', NULL, NULL, '6c49968c338a478e8a38af877ab58773', NULL, NULL, NULL, '2017-10-24 03:12:39', '0000-00-00 00:00:00', 3),
('76ddf395c9c34fc197095bf4bd2a9134', '912d9593719d455e9b4bac07063e7805', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Cải tiến kỹ thuật kiểm thử trong SMT solver raSAT', '', 0, 'Tính thỏa mãn (Satisfiability –  SAT) là một trong những vấn đề quan  trọng của \nkhoa học máy tính,  đây là bài toán  xác định liệu rằng  một công thức ràng buộc có giải \nđược  hay không.  Tuy nhiên, việc giải bài toán thỏa mãn không chỉ trong một trường hợp \ncụ thể mà nó còn tùy thuộc vào các lý thuyết nền tảng. Việc nghiên cứu này gọi là bài \ntoán lý thuyết modulo  về tính thỏa mãn –  SMT (Satisfiability Modulo Theories). SMT \ncó ý nghĩa to lớn, và được vận dụng trong rất nhiều ứng dụng, đây là một vấn đề được \nquan tâm hàng đầu, là một bài toán khó và thách thức. SMT luôn được phát triển trong\ncác buổi Hội thảo SMT, các cuộc thi giải bài toán SMT được tổ chức hằng năm, thu hút \nrất nhiều các nhà nghiên cứu, tổ chức, các trường đại học. Thông qua các cuộc thi, các \nbộ giải SMT Solver được giới thiệu và ngày càng được cải tiến để tăng hiệu giải toán.\nVì thế, khóa luận tìm hiểu về bài toán SMT, bộ giải SMT Solver, các lý thuyết \nnền tảng và các phương pháp giải bài toán SMT. Khóa luận cũng giới thiêụ công cụ giải \nSMT là raSAT, đây là một công cụ  giải bài toán ràng buộc đa thức – một trong những \nứng dụng quan trọng của bài toán SMT, công cụ  tham gia vào SMT-COMP và đã đạt \nđược kết quả  khá tốt,  ở  đây, khóa luận đi sâu vào việc cải tiến kỹ thuật kiểm thử áp dụng trong raSAT từ những kỹ thuật đã được sử dụng để so sánh và có những biện pháp, kết quả tốt hơn, ưu việt hơn các kỹ thuật cũ.', '', NULL, NULL, NULL, '2828d360ca134f62ad35cf1e89088534', NULL, NULL, '2828d360ca134f62ad35cf1e89088534', NULL, NULL, NULL, '2017-10-24 03:12:34', '0000-00-00 00:00:00', 3),
