('786dc737f5e546c2b0c62f44f5797eff', 'b531729a96ca436b9368ab80151d0c50', 'e73123fc886e4583bd535843b19aeb3f', 1, 103, 'Nghiên cứu phát triển ứng dụng phát hiện lỗ hổng trong các hệ thống thông tin', 'Research and development of vulnerability detection in information systems', 1, 'Nghiên cứu,phát triển lỗ hỏng,mã độc trong các ứng dụng của một hoặc nhiều tập hợp hệ thống nào đó.', 'Security', NULL, NULL, NULL, '2a140b59873b41ab8597c0dcc6e8fa76', NULL, NULL, '2a140b59873b41ab8597c0dcc6e8fa76', NULL, NULL, NULL, '2017-10-24 03:12:39', '0000-00-00 00:00:00', 3),
('79748f237d5940a7888df04ae92f36a5', '910ba1c4518b4b829a537105dbc9d797', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Kỹ thuật thực thi tượng trưng và ứng dụng trong kiếm chứng một số tính chất của chương trình', '', 0, 'Đề tài tập trung trình bày về kỹ thuật thực thi tượng trưng, giới thiệu tổng quan, vai trò và hướng phát triển trong kiếm chứng phần mềm, cùng với đó là ứng dụng của kỹ thuật thực thi tượng trưng trong việc kiểm chứng một số tính chất của chương trình.', 'Công nghệ phần mềm, kiểm chứng chương trình', NULL, NULL, NULL, '2828d360ca134f62ad35cf1e89088534', NULL, NULL, '2828d360ca134f62ad35cf1e89088534', NULL, NULL, NULL, '2017-10-24 03:12:35', '0000-00-00 00:00:00', 3),
('7a90aed27648440db68f7966a98d03cf', '75b2b0b9597b48e9bac18dd40d28e4de', '635c095a54624491977e3755da3934fb', 1, 103, 'Xây dựng hệ thống chỉ dẫn trên mobile', '', 0, 'Hệ thống cho phép người dùng khi tham gia vào hệ thống có thể biết được vị trí chính xác của những người bạn và giúp chỉ dẫn đường đến nơi muốn đến.', '', NULL, NULL, NULL, '2828d360ca134f62ad35cf1e89088534', 'de4d21f072554fddb18513c630b98425', NULL, '2828d360ca134f62ad35cf1e89088534', NULL, NULL, NULL, '2017-10-24 03:12:35', '0000-00-00 00:00:00', 3),
