('8350b17f4220411d9dd74212f856db48', 'a3251a9c902f4398a57fca81dd960816', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Xây dựng bộ kiểm thử tự động chung cho các ứng dụng web dựa trên Robot Framework.', '', 0, 'Robot Framework là một testing framework. Nó cung cấp mọi thứ cần thiết để xây dựng và phát triển một kịch bản kiểm thử, gồm điều kiện đầu vào/kết thúc, báo cáo kết quả, ... Điểm hấp dẫn của Robot Framework với các tester chính là chúng ta không cần quan tâm đến các thuật toán lập trình cơ bản nhất. Mọi thứ chúng ta cần làm chính là viết ra một kịch bản kiểm thử dựa trên các từ khóa (keyword) mà thôi.', 'Automation test', NULL, NULL, NULL, '555bc970fee445349856662344f4e8fa', '928a95032edc422db1985d70c6eed91a', NULL, '928a95032edc422db1985d70c6eed91a', NULL, NULL, NULL, '2017-10-24 03:12:40', '0000-00-00 00:00:00', 3),
