('856de3d8ce4e4b22bc2853d6744e2c35', 'be233e3d000e49618a997ac816ec2781', 'f325ef87ee92442bb17353d9fdf6124a', 1, 103, 'Phân vùng ngữ nghĩa cho ảnh viễn thám', 'Semantic segmentation for remote sensing image', 1, 'Semantic segmentation is a fundamental task in remote sensing image processing. The large appearance variations of ground objects make this task quite challenging for classical machine learning.', '', NULL, NULL, NULL, 'cffeecc37bd549a0ba0e60029c7752b2', '3797863ff648440b9f27c3229ccda974', NULL, 'b2c4a0310ca8433f8471425cc50fa9fe', NULL, NULL, NULL, '2017-10-24 03:31:42', '0000-00-00 00:00:00', 3),
