('8c34ce654d2c4bb88e6334ff222e20f7', '69f926d046704149a40c0dedf48f1530', 'bebe3f425eb0467586f34834ad4bd17c', 1, 103, 'Đếm tinh trùng chuột sử dụng các phương pháp thị giác máy', 'Mice sperms counting using computer vision methods', 1, 'Theo thống kê của các bệnh viện lớn tại Hà Nội, tình trạng chất lượng tinh trùng của nam giới đang ngày càng giảm vì nhiều lý do như ô nhiễm môi trường, thức ăn bẩn, chất kích thích ... Dẫn đến nhu cầu xét nghiệm tinh trùng tăng cao đột biến gây quá tải với các trung tâm. Với phương pháp xét nghiệm cũ thực hiện hoàn toàn thủ công rất mất thời gian và công sức. Khoá luận sử dụng các phương pháp thị giác máy để hỗ trợ việc đếm một cách tự động. Nâng cao hiệu suất, giảm công sức và thời gian cho công việc thủ công này. Thí nghiệm được sử dụng trên chuột vì dễ lấy dữ liệu hơn trên người.', 'Thị giác máy, Học máy, Tin sinh học', NULL, NULL, NULL, '31785f8fb9a04b00b50dd3c4a3bea5bb', '47860b8fe9cc42e897a413f04dda8fb7', NULL, '47860b8fe9cc42e897a413f04dda8fb7', NULL, NULL, NULL, '2017-10-24 03:12:33', '0000-00-00 00:00:00', 3),
