('92018796f63c40018369f355df4a0e79', '7dfc7c8012be417287c5ca2ba676c0c9', 'baee3b743d9f4581b015aa3b202f3eae', 1, 103, 'Nhận diện thực thể lồng nhau trong hệ thống chatbot đặt hàng', '', 0, 'Bài toán cho phép trích xuất những entity trong câu hội thoại. Entity trong ngữ cảnh này không chỉ là những thực thể có tên gọi (như tên người, địa điểm, etc) mà có nghĩa rộng hơn. Đó có thể là những danh từ chỉ số lượng, đơn vị, thuộc tính của mặt hàng.\nBài toán nhận diện thực thể lồng nhau sẽ được giải quyết trong một miền ứng dụng cụ thể. Ở đây chúng ta lựa chọn miền ứng dụng đặt hàng của thecoffeehouse để xây dựng dữ liệu, lựa chọn mô hình và thử nghiệm đánh giá kết quả.', '', NULL, NULL, NULL, '2721cbe23b8e42c596a389d0e18ff8eb', 'd392bb584350452abb2d0afd2f757de2', NULL, '2721cbe23b8e42c596a389d0e18ff8eb', NULL, NULL, NULL, '2017-10-24 03:12:34', '0000-00-00 00:00:00', 3),
