('9b560677cabb499c924122cd322e1ee5', '6aae5e48f1c24a65a71e429e40c1590f', 'baee3b743d9f4581b015aa3b202f3eae', 1, 103, 'Suy diễn thông tin người dùng dựa trên phân tích đồ thị các mối quan hệ.', '', 0, 'Bài toán User profling\nInput: 1 user hoặc 1 tập các user. Các user chưa có thông tin về độ tuổi, giới tính,..\nOutput: Gán nhãn độ tuổi, giới tính,.. cho người dùng hoặc tập người dùng đó.\nKỹ thuật chính: Thuật toán Node2vec và một số kỹ thuật cải tiến, Facebook graph API.', '', NULL, NULL, NULL, '77de2c69fca4437490cd433b846eeffe', '27b9405bcbb04f018fdf1b5acd39b7a7', NULL, '77de2c69fca4437490cd433b846eeffe', NULL, NULL, NULL, '2017-10-24 03:12:35', '0000-00-00 00:00:00', 3),
