('9dfebbb7f3284dbd88b84b49a6ba8ce5', 'd9d3e1a4738b4252b426d7b1ec42030a', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 888, 'Sử dụng Jenkins để tạo Continuous Integration (CI) tool.', '', 0, 'Sau khi package application developer phải test, build lại package đó. Solution hiện tại khá nhiều người sử dụng Jenkin để build các source code đó. Chúng ta sẽ tạo một CI tool bằng web application có sử dụng các api của Jenkins để giúp developer tự động trigger source code từ github sau đó tự động build và trả về log của quá trình build đó.', 'Web application, Jenkins, CI tool', NULL, NULL, NULL, '7c3955967abb44c4b7ed3136aeb8293b', NULL, NULL, '7c3955967abb44c4b7ed3136aeb8293b', '2017-08-07 00:00:00', '2017-12-20 09:27:26', '2017-12-20 09:27:26', '2017-05-08 04:49:27', '0000-00-00 00:00:00', 2),
('9e173d9cf03d433c9c4502b4d3eeacdd', '639bdd9a3c4f437fb5f10412e5b4fa13', 'bebe3f425eb0467586f34834ad4bd17c', 1, 103, 'Giải bài toán tối ưu ảnh hưởng trên mạng xã hội', '', 0, 'Bài toán tối ưu ảnh hưởng là một vấn đề tối ưu tổ hợp khó. Bài toán yêu cầu xác định một tập tối ưu các đỉnh mạng k mà sự kích hoạt của k đỉnh mạng này sẽ kích hoạt được một tổng số tối đa các nút mạng còn lại với một mô hình lan truyền đã chọn.', '', NULL, NULL, NULL, '7d0afd81aff848a4b5d673d75580dc80', NULL, NULL, '7d0afd81aff848a4b5d673d75580dc80', NULL, NULL, NULL, '2017-10-24 03:12:38', '0000-00-00 00:00:00', 3),
