('a0f449ba2e68484eb9795628e4f766a3', '9d0b5f2d9a3e4b21be51431ea0c12ac0', 'e73123fc886e4583bd535843b19aeb3f', 1, 103, 'Lập trình trên nền tảng Android và ứng dụng', '', 0, 'Xây dựng ứng dụng trên điện thoại sử dụng hệ điều hành Android mục đích quản lý hóa đơn điện tử.', '', NULL, NULL, NULL, '632ad8ef939b425eb620b3903f10200a', NULL, NULL, '632ad8ef939b425eb620b3903f10200a', NULL, NULL, NULL, '2017-10-24 03:12:38', '0000-00-00 00:00:00', 3),
('a11ab1e1d12d4e61b2dfd1e44ab67a09', 'a557825773f54774a8c789955f0c43e0', 'f325ef87ee92442bb17353d9fdf6124a', 1, 103, 'S.O.S app for motorbike', '', 0, 'Hỗ trợ người đi xe máy trong trường hợp thủng lốp, chết máy hoặc hết xăng. \nKhi người người dùng có yêu cầu cần hỗ trợ, ứng dụng sẽ thu thập tín hiệu của các cửa hàng xung quanh và hiển thị map, người dùng có quyền lựa chọn cửa hàng để gọi cứu hộ, khi đó nhân viên cửa hàng cứu hộ được người dùng lựa chọn sẽ tìm đến người dùng cần hỗ trợ (người dùng không cần phải dắt xe đến cửa hàng)', '', NULL, NULL, NULL, '63aa694de6c24a68ba3a8679c1817a45', NULL, NULL, '63aa694de6c24a68ba3a8679c1817a45', NULL, NULL, NULL, '2017-10-24 03:12:39', '0000-00-00 00:00:00', 3),
('a1912b11af7d4c508d0b19d82a6d286e', '981b275bf7ee4c06a55fb809527f799f', '6fa0b48987ea4f248e0c48353679ecd0', 1, 103, 'Kiểm duyệt nội dung các bài viết và bình luận trên mạng xã hội', '', 0, 'Hiện nay nội dung trên các trang web nói chung và các trang mạng xã hội nói riêng đang ngày càng vượt khỏi tầm kiểm duyệt của người quản trị cũng như người xem. Đề tài hướng tới có thể phân tích nội dung, dựa trên nội dung phân tích được để quyết định xem nó có phải là nội dung hợp lệ hay không.', 'Natural Language Processing, Moderation, ...', NULL, NULL, NULL, '0f32b72630d848e2b22135e2eb11c25f', '484343d991b2466aa2425a9da7ad1d50', NULL, '0f32b72630d848e2b22135e2eb11c25f', NULL, NULL, NULL, '2017-10-24 03:12:35', '0000-00-00 00:00:00', 3),
('a1f65cfbf74a49b2927e39ae8c420d22', '84b974f4b52e4eea96dba89e98a53536', 'bebe3f425eb0467586f34834ad4bd17c', 1, 103, 'Phân vùng ảnh theo ngữ nghĩa thời gian thực', 'Real-time semantic image segmentation', 1, 'Semantic image segmentation is a fundamental task in computer vision. It predicts dense labels for all pixels in the image, and is regarded as a very important task that can help achieve deep understanding of scene, objects, and human. It is important to make semantic segmentation run fast while not sacrificing too much quality is left far behind since it can inspire or enable many practical tasks in, for example, automatic driving, robotic interaction, online video processing, and even mobile computing where running time becomes a critical factor to evaluate system performance.', '', NULL, NULL, NULL, '47860b8fe9cc42e897a413f04dda8fb7', '084b9c979d434d45bdcc73a427d7ebfd', NULL, '47860b8fe9cc42e897a413f04dda8fb7', NULL, NULL, NULL, '2017-10-24 03:12:33', '0000-00-00 00:00:00', 3),
('a413493e0be442fd84c3a56592cfca57', '2935913566614308858e022c6eeed98a', '6fa0b48987ea4f248e0c48353679ecd0', 1, 888, 'Tích hợp các công cụ quét lỗ hổng an ninh vào hệ thống hỗ trợ phòng chống tội phạm sử dụng công nghệ cao.', '', 0, 'Tích hợp các công cụ để phát hiện các lỗ hổng trên các ứng dụng web qua đó giúp giúp đưa ra các phương pháp tấn công và bảo vệ.', 'Tích hợp các công cụ, lỗ hổng an ninh, an ninh ứng dụng web, phòng chống tội phạm công nghệ cao', NULL, NULL, NULL, 'b942f4b3740f494bbc88c41ec3692626', NULL, NULL, 'b942f4b3740f494bbc88c41ec3692626', '2017-08-07 00:00:00', '2017-12-20 09:27:26', '2017-12-20 09:27:26', '2017-05-08 04:49:27', '0000-00-00 00:00:00', 2),
