('a60a60f84ec34fe297abd992fd556c63', 'efcfdb924a9845039047df34afe30df5', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 103, 'Tăng hiệu năng cho server bằng hệ thống HTTP File Caching', 'Improve server performance with HTTP File Caching Server', 1, 'Đề tài xây dựng hệ thống Caching Server bằng ngôn ngữ C++ nhằm tăng tối đa khả năng phục vụ của server, đặc biệt với các file kích cỡ lớn như file ảnh, nhạc và video.', '', NULL, NULL, NULL, '7c3955967abb44c4b7ed3136aeb8293b', NULL, NULL, '7c3955967abb44c4b7ed3136aeb8293b', NULL, NULL, NULL, '2017-10-24 03:12:33', '0000-00-00 00:00:00', 3),
('a635cbc9357e4c9d809e6368beef9d71', '1d52746ef0984988893632edf306cbec', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 103, 'Phát triển ứng dụng hướng dẫn viên du lịch ảo dựa trên thông tin vị trí', '', 0, 'Ứng dụng được xây dựng trên nền tảng Android, hiển thị thông tin về các hiện vật trưng bày trong viện bảo tảng, di tích lịch sử, khu du lịch theo vị trí người dùng.', '', NULL, NULL, NULL, 'e6828068a622452aa3e4b51120f0b378', NULL, NULL, 'e6828068a622452aa3e4b51120f0b378', NULL, NULL, NULL, '2017-10-24 03:12:38', '0000-00-00 00:00:00', 3),
