('a978550af0e84e819aef78e51c9b6bb2', 'e04d14ae72964bf581404d3eef285aed', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Tìm hiểu và vận dụng ngôn ngữ mô hình hóa chuyên biệt miền DCSL', '', 0, 'Tìm hiểu ngôn ngữ mô hình hóa chuyên biệt miền DCSL để vận dụng kiểm thử tự động các phần mềm hướng đối tượng được thiết kế bằng ngôn ngữ chuyên biệt miền DCSL\n        - Đầu vào: \n                 + Mô hình thiết kế dạng UML/DCSL của một chương trình hướng đối tượng tiêu biểu. Chương trình tiêu biểu cần đầy đủ các thành phần mà DCSL có thể diễn đạt và ở dạng rút gọn nhất.\n                  + Một thư viện các hàm sinh dữ liệu kiểm thử nguyên thủy cho mỗi loại dữ liệu xuất hiện trong mô hình thiết kế\n         - Đầu ra: Một tập dữ liệu kiểm thử (testcase set) cho mỗi lớp trong mô hình thiết kế. Tập dữ liệu kiểm thử cần bao gồm các dữ liệu đúng và sai, được xác định theo đặc tả thiết kế của mỗi lớp', '', NULL, NULL, NULL, '25e2711f30fa4e3c99436703bac2b694', 'c0fdd6fc630243ba8ab2d763da6a592c', NULL, '25e2711f30fa4e3c99436703bac2b694', NULL, NULL, NULL, '2017-10-24 03:12:37', '0000-00-00 00:00:00', 3),
('aaf45154c46d49d68265f340a0ddcb48', '2cbef8f433a24bdb9fd11aa60896a811', '7c4d87122f8f4fc5b17db4708cbe0039', 1, 103, 'Điều khiển robot Fetch trong nhà kho', '', 0, 'Robot fetch hiện nay được ứng dụng trong việc lấy hàng hóa trong kho và được các công ty lớn như Amazon sử dụng. Việc lập trình điều khiển robot giúp ta có thể lấy hàng hóa nhanh chóng, thuận tiện và dễ dàng hơn là sử dụng sức người để lấy hàng hóa vì kho hàng thường rộng và hàng hóa có thể không được sắp xếp đúng vị trí.', '', NULL, NULL, NULL, '3797863ff648440b9f27c3229ccda974', '31785f8fb9a04b00b50dd3c4a3bea5bb', NULL, '3797863ff648440b9f27c3229ccda974', NULL, NULL, NULL, '2017-10-24 03:12:36', '0000-00-00 00:00:00', 3),
