('af90a995952849ed96c328fe84591a7e', 'bc3b9c8782ed4ebe90e86f86e0c0af24', '74466d128f204a42ac033479305cf9b5', 1, 103, 'Hệ thống học nhóm trực tuyến', '', 0, 'Bài toán “Học nhóm trực tuyến” mô phỏng quá trình học nhóm của một nhóm người, thay vì phải trực tiếp gặp mặt đầy đủ các thành viên, để giải quyết một bài toán, một đề tài nào đó, thì các thành viên có thể ở bất cứ đâu vẫn có thể nêu lên được ý kiến của mình để giải quyết bài toán.', '', NULL, NULL, NULL, 'f8b0214521924077b3890f38e09fdc39', 'b8964c52fde94343aed9f6ab5178502b', NULL, 'f8b0214521924077b3890f38e09fdc39', NULL, NULL, NULL, '2017-10-24 03:12:39', '0000-00-00 00:00:00', 3),
