('afc4542137364ae2ad60947adf0a89d2', 'd579f517733143faa05a77d76f20503d', 'ee19a8616e6a468f8f727fb5be89f20b', 2, 102, 'g gdgsdfsd', '', 0, 'sdfdsf', '', NULL, '/uploads/dangki/luanvan/2017/hoc_vien_abc.pdf', NULL, '4453ccfbeb9541bb8ab9604716f5a8ac', NULL, NULL, '4453ccfbeb9541bb8ab9604716f5a8ac', NULL, NULL, NULL, '2017-10-03 12:37:55', '0000-00-00 00:00:00', 1),
('affa4e51d9d448df87d2a238bb619644', '766a9522990c4d919c59b6188407ea94', 'bebe3f425eb0467586f34834ad4bd17c', 1, 103, 'Khai phá kho ngữ liệu song ngữ cho dịch máy Nhật-Việt', '', 0, 'Kho ngữ liệu song ngữ là một tài nguyên không thể thiếu trong nghiên cứu và phát triển các hệ thống dịch máy thống kê. Với cặp ngôn ngữ như Nhật-Việt vấn đề này càng thiết yếu. Khóa luận tập trung vào tiếp cận khai thác kho ngữ liệu song ngữ một cách tự động từ các nguồn như sách song ngữ, trang web, ... Các công việc chính để thực hiện khóa luận bao gồm: (1) Tìm hiểu chung về bài toán dịch máy, tiếp cận dịch máy thống kê, bài toán khai phá dữ liệu song ngữ; (2) Các bước khai phá dữ liệu song ngữ; (3) Xây dựng hệ thống khai phá dữ liệu song ngữ, tiến hành thử nghiệm.', '', NULL, NULL, NULL, '3a8ef5dc78694e9abe83ae0221debc90', NULL, NULL, '3a8ef5dc78694e9abe83ae0221debc90', NULL, NULL, NULL, '2017-10-24 03:12:37', '0000-00-00 00:00:00', 3),
('b22c9167bfa740a498eb53a2a5a04d36', '7bae81087e46491085a8fb5933c7821a', 'f325ef87ee92442bb17353d9fdf6124a', 1, 103, 'Nghiên cứu phương pháp phân loại tự động lớp phủ lúa ở Đồng bằng sông Hồng sử dụng ảnh vệ tinh Sentinel 1A', '', 0, 'Lúa là một loại cây trồng quan trọng, cung cấp lương thực cho phần lớn dân số Việt Nam. Tuy nhiên, diện tích trồng lúa ở Việt Nam hiện tại đang bị suy giảm nghiêm trọng do quá trình đô thị hóa và công nghiệp hóa mạnh mẽ, đặc biệt là ở miền Bắc Việt Nam. Do vậy, việc giám sát diện tích trồng lúa kịp thời là vô cùng quan trọng, giúp đảm bảo cho an ninh lương thực ở Việt Nam. Khóa luận này tập trung nghiên cứu phương pháp xác định diện tích lúa ở Đồng bằng sông Hồng sử dụng dữ liệu ảnh vệ tinh radar Sentinel 1A. Đóng góp mới của đề tài là phương pháp phân lớp lúa sử dụng dữ liệu ảnh radar. Bên cạnh đó, đây là loại dữ liệu có nhiều tiềm năng nhưng chưa được ứng dụng nhiều do độ phức tạp cao và yêu cầu phần cứng mạnh. Kết quả cuối cùng là phương pháp và bản đồ lúa, cung cấp thông tin cho nhà quản lý và những người quan tâm.', '', NULL, NULL, NULL, 'ce95ee8cedbb46e9b99d0fd637e4eb06', '73b5532ce7a74051a601aa801ad348bf', NULL, 'ce95ee8cedbb46e9b99d0fd637e4eb06', NULL, NULL, NULL, '2017-10-24 03:12:36', '0000-00-00 00:00:00', 3),
('b3252387368d4018958610c5812c2dd3', '2e5bc73b165a44598cb1d26bc401fbbe', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 103, 'Xây dựng ứng dụng đồng bộ nội dung cho các sàn thương mại điện tử sử dụng công nghệ web automation Phantom JS', '', 0, 'Xây dựng ứng dụng đồng bộ nội dung cho các sàn thương mại điện tử sử dụng công nghệ web automation Phantom JS', 'Thương mại điện tử', NULL, NULL, NULL, '6d329af6b6d74839a6d8fce569346bd7', NULL, NULL, '6d329af6b6d74839a6d8fce569346bd7', NULL, NULL, NULL, '2017-10-24 03:12:39', '0000-00-00 00:00:00', 3),
('b464e77a2d174a32bed1656cdedd9745', '018daa21c28841baaab911846c8c5ee4', 'e73123fc886e4583bd535843b19aeb3f', 1, 103, 'Kiểm thử hiệu năng website bằng Jmeter', '', 0, 'Kiểm thử hiệu năng sẽ làm rõ ràng những rủi ro của việc triển khai hệ thống, từ đó giảm bớt những rủi ro, ngăn ngừa hệ thống downtime và sẵn sàng trước các vấn đề gặp phải. Jmeter là công cụ trong nhiều công cụ để đo độ tải và performance của hệ thống, có thể sử dụng để test performance trên cả nguồn tĩnh và nguồn động, có thể kiểm tra độ tải và hiệu năng trên nhiều loại server khác nhau như: Web – HTTP, HTTPS, SOAP, Database via JDBC, LDAP, JMS, Mail – SMTP(S), POP3(S) và IMAP(S)…', '', NULL, NULL, NULL, 'dd0bd14615484973abfdfa3633bdcc0a', NULL, NULL, 'dd0bd14615484973abfdfa3633bdcc0a', NULL, NULL, NULL, '2017-10-24 03:12:39', '0000-00-00 00:00:00', 3),
