('b53a174e7e4f4cc6ba280991fabdc65d', '77ab43eba41a42889902b1f204e1f031', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Xây dựng hệ thống kiểm tra nhanh bài trên lớp: mô-đun điện thoại', '', 0, 'Đây là hệ thống hỗ trợ giáo viên xây dựng các bài kiểm tra nhanh trên lớp. Hệ thống có một ngân hàng câu hỏi để giáo viên chọn, giáo viên cũng có thể tự tạo câu hỏi cho riêng lớp của mình . Mô đun điện thoại của hệ thống sử dụng camera để nhận diện đáp án thông qua các mã được phát cho học sinh.  Học sinh sử dụng một tờ giấy có mã để nhận biết thông tin cá nhân của học sinh và đáp án. Sau đó hệ thống sẽ thống kê các đáp án của các học sinh và hiển thị cho giáo viên.', '', NULL, NULL, NULL, '928a95032edc422db1985d70c6eed91a', '1fe71f2e657e470b8d4666e71ba9fdb9', NULL, '928a95032edc422db1985d70c6eed91a', NULL, NULL, NULL, '2017-10-24 03:12:38', '0000-00-00 00:00:00', 3),
