('b65554b1234c423b93d6f09bd5473fed', '63fc7bb7b603446d97deedc5c9c50880', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Xây dựng công cụ hỗ trợ đánh giá kỹ năng thực hành tin học cơ sở sử dụng công nghệ VSTO Add-ins của Microsoft', '', 0, 'Hiện nay việc đánh giá tự động kỹ năng tin học cơ sở vẫn được thực hành thủ công và chưa có công cụ. Khóa luận này xây dựng công cụ cho phép người dùng thực hành các môn tin học cơ sở theo cách tự động và rút ngắn quá trình đánh giá kỹ năng.', '', NULL, NULL, NULL, '8d2754fe281648619a6b02d5327fb4d4', 'bcb186ffa70e46b2be874fe2e31a62e6', NULL, '8d2754fe281648619a6b02d5327fb4d4', NULL, NULL, NULL, '2017-10-24 03:12:34', '0000-00-00 00:00:00', 3),
