('b72ea8206f1b45a3854db7b5deb510f8', '46c15c51bcd747128434c977cebdacc2', 'baee3b743d9f4581b015aa3b202f3eae', 1, 103, 'Tóm tắt văn bản sử dụng kỹ thuật seq2seq', '', 0, 'Khóa luận này sẽ tập trung giải quyết bài toán tóm tắt văn bản sử dụng kỹ thuật học sâu Sequence to Sequence.\nKhóa luận tìm hiểu việc áp dụng các mô hình mạng nơ-ron (NN), cụ thể là mô hình LSTM, để tóm tắt văn bản bằng cách sinh tiêu đề tự động cho nội dung văn bản. Khóa luận áp dụng mô hình LSTM encoder-decoder với cơ chế được đào tạo có sử dụng điện toán đám mây, Amazon Web Services (AWS) Elastic\nCompute Cloud (EC2), sử dụng framework học sâu của Google là TensorFlow.', '', NULL, NULL, NULL, '27b9405bcbb04f018fdf1b5acd39b7a7', 'e18fe077503e4e34bf6fc919d5f2a5e2', NULL, '27b9405bcbb04f018fdf1b5acd39b7a7', NULL, NULL, NULL, '2017-10-24 03:12:40', '0000-00-00 00:00:00', 3),
