('bf3a0f42419e4c26b6f5c35013f6a87f', '8cda72a8efb247998a75e6271d22e90c', 'baee3b743d9f4581b015aa3b202f3eae', 1, 103, 'TƯ VẤN XÃ HỘI DỰA TRÊN PHÂN TÍCH CÁC ĐẶC TÍNH THEO KHÔNG GIAN VÀ THỜI GIAN', '', 0, 'Một vài năm gần đây, với sự phát triển mạnh mẽ các phương tiện xã hội như Facebook, Youtube, thông tin có ích cho người dùng từ đây cũng ngày một nhiều hơn. Tư vấn, gợi ý cho người dùng đọc gì, xem gì,… dựa trên dữ liệu phương tiện xã hội là một nhiệm vụ quan trọng của các phương tiện xã hội. giúp nâng cao tương tác giữa người dùng với các phương tiện là một hoạt động quan trọng và cần thiết.\n\nKhông gian: là những đặc tính, sở thích của người dùng đã có và những thứ sẽ được thêm vào bởi người dùng thông qua phân tích thao tác của người dùng, dựa vào đó ta đề xuất những tư vấn cho người dùng,\n\nThời gian: là những hoạt động của người dùng có liên quan tới những đặc tính, sở thích đã có của người dùng trước đó, nếu những đặc tính đã có mà trong thời gian quá lâu không có sự liên quan gì đến những hoạt động của người dùng thì sẽ bị loại bỏ, ngược lại những đặc tính mới sẽ được cập nhật và thêm vào.', '', NULL, NULL, NULL, '77de2c69fca4437490cd433b846eeffe', NULL, NULL, '77de2c69fca4437490cd433b846eeffe', NULL, NULL, NULL, '2017-10-24 03:12:38', '0000-00-00 00:00:00', 3),
('c07c4f40510f4af5bd28957b1e9e6139', 'f233568130f54481800829ce6c948763', 'f325ef87ee92442bb17353d9fdf6124a', 1, 103, 'Điều khiển Robot Nao thông qua nhận dạng cử chỉ tay', '', 0, 'Điều khiển Robot Nao thông qua nhận dạng cử chỉ tay', '', NULL, NULL, NULL, 'b2c4a0310ca8433f8471425cc50fa9fe', 'a4adc60b909346ffb4148d2e243d09aa', NULL, 'b2c4a0310ca8433f8471425cc50fa9fe', NULL, NULL, NULL, '2017-10-24 03:12:34', '0000-00-00 00:00:00', 3),
('c0830fc53d384239aedd9a54023dd36a', '2452386770c74be8b13ca023811999ad', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 103, 'Xác định phân bố cường độ ánh sáng trong phòng dựa trên ảnh camera', '', 0, 'Phân tích ánh sáng thông qua ảnh chụp được từ camera', '', NULL, NULL, NULL, 'e6828068a622452aa3e4b51120f0b378', NULL, NULL, 'e6828068a622452aa3e4b51120f0b378', NULL, NULL, NULL, '2017-10-24 03:12:38', '0000-00-00 00:00:00', 3),
('c1f5794a85434fde90a2cba4804ef46e', '3c5542fc760f4da388a0e22b6836884c', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 103, 'Xây dựng một mạng neuron nhân tạo nhiều lớp để phân loại', '', 0, 'Xây dựng mạng neuron nhân tạo làm cơ sở cho các bài toán phân loại dựa trên học máy: ví dụ nhận dạng hình ảnh, nhận dạng đối tượng, ...\nBộ não con người bao gồm 100 tỉ tế bào gọi là tế bào thần kinh (neuron), kết nối với nhau bằng các khớp thần kinh. Nếu một khớp thần kinh của một tế bào có đủ năng lượng và phát sáng, tế báo đó cũng sẽ phát sáng — truyền tiếp dữ liệu. Chúng ta gọi quá trình này là “suy nghĩ”.\n\nChúng ta có thể mô hình quá trình này bằng cách tạo ra một mạng lưới thần kinh trên một máy tính. Chúng ta sử dụng một kỹ thuật gọi là ma trận toán học, đó là lưới của các con số. \nĐề tài được thực hiện bằng ngôn ngữ Python.', '', NULL, NULL, NULL, 'ada72c1fa3e648679bcaf464cef8e2b0', NULL, NULL, 'ada72c1fa3e648679bcaf464cef8e2b0', NULL, NULL, NULL, '2017-10-24 03:12:39', '0000-00-00 00:00:00', 3),
('c27ddf1e2b474056a900ddc7dd54fa0d', 'ee9988c8736d408ebd17b726e6465302', 'e73123fc886e4583bd535843b19aeb3f', 2, 888, 'Các thuật toán học tự động trong phân tích cú pháp phụ thuộc', '', 0, 'Các thuật toán học tự động trong phân tích cú pháp phụ thuộc', '', NULL, '/uploads/dangki/luanvan/2017/do_van_viet.pdf', NULL, '8be07a89e69c44e9a71085306a54e8cf', NULL, NULL, '8be07a89e69c44e9a71085306a54e8cf', '2017-06-16 10:44:47', '2019-11-18 10:44:47', '2019-11-18 10:44:47', '2017-09-15 09:54:13', '0000-00-00 00:00:00', 1),
('c332783a47804c8aac85e0181168ab30', 'b71a0f5c96694e7ba4ca0377db2913eb', '635c095a54624491977e3755da3934fb', 1, 100, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-10-24 03:12:38', '0000-00-00 00:00:00', 3),
('c4707909909a4706bb6a88c75f137237', '267f56b515f447b8909560669637e17f', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 103, 'Xây dựng hệ thống quản lý nội dung trên Facebook', '', 0, 'Mục tiêu của khóa luận là tạo ra một công cụ hỗ trợ người dùng đăng tải nội dung trên facebook một cách nhanh chóng thuật tiện. Công cụ này nhắm tới đối tượng là các doanh nghiệp có nhu cầu đăng tải nội dung và tương tác với khách hàng thường xuyên, giúp tăng hiệu quả hoạt động trên mạng xã hội.', '', NULL, NULL, NULL, '6d329af6b6d74839a6d8fce569346bd7', NULL, NULL, '6d329af6b6d74839a6d8fce569346bd7', NULL, NULL, NULL, '2017-10-24 03:12:36', '0000-00-00 00:00:00', 3),
('c4ed119b03e1410e87a00e97ab439a31', '6a3d4faf3932468ba4e0806767ac3039', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Xây dựng ứng dụng thiết lập bản quyền dựa trên công nghệ chuỗi khối', '', 0, 'Chuỗi khối (blockchain) là một cơ sở dữ liệu phân tán lưu trữ thông tin trong các khối thông tin được liên kết với nhau bằng mã hóa và mở rộng theo thời gian. Mỗi khối thông tin đều chứa thông tin về thời gian khởi tạo và được liên kết tới khối trước đó, kèm một mã thời gian và dữ liệu giao dịch. Blockchain được thiết kế để chống lại việc thay đổi của dữ liệu và áp dụng đặc tính này của blockchain đề tài của em đưa ra một phương pháp nhằm xác minh bản quyền của dữ liệu.', '', NULL, NULL, NULL, '928a95032edc422db1985d70c6eed91a', '1fe71f2e657e470b8d4666e71ba9fdb9', NULL, '928a95032edc422db1985d70c6eed91a', NULL, NULL, NULL, '2017-10-24 03:12:35', '0000-00-00 00:00:00', 3),
('c59fee2af8204d7d92c77ff789744913', '53ecf9a4f4364c128b6d30cd0e2b5006', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 888, 'Ứng dụng QR code và cloud để kiểm kê hàng hóa trong siêu thị.', '', 0, 'Mã QR một mã ma trận được phát triển bởi công ty Denso Wave (Nhật Bản) vào năm 1994. Các mã QR được sử dụng phổ biến nhất ở Nhật Bản, và hiện là loại mã hai chiều thông dụng nhất ở Nhật Bản. \nAmazon Web Services là tập hợp các dịch vụ cung cấp cho người lập trình có khả năng truy cập tới hạ tầng kiến trúc tính toán kiểu sẵn sàng-để-sử dụng (ready-touse) của Amazon.\nTrong quá trình vận hành siêu thị, kiểm kê hàng hóa là một phần không thể thiếu. Hiện tại việc kiểm kê này tại những siêu thị ở Việt Nam đa số thủ công, dùng mắt thường để kiểm kê. Việc này dẫn đến mất thời gian và dễ gây nhầm lẫn. Ngày nay công nghệ phát triển, rất nhiều công nghệ cho phép người lập trình tạo ra những ứng dụng để giải quyết bài toán trên, có thể kể đến  QR code và AWS.', 'Ứng dụng, QR', NULL, NULL, NULL, 'e6828068a622452aa3e4b51120f0b378', NULL, NULL, 'e6828068a622452aa3e4b51120f0b378', '2017-08-07 00:00:00', '2017-12-20 09:27:26', '2017-12-20 09:27:26', '2017-05-08 04:49:27', '0000-00-00 00:00:00', 2);
