('cafb588d411f4b159d5168f58b4267bb', '8be0a0f01b30441c84468725d3637213', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 103, 'Hệ thống ươm tạo doanh nghiệp làng nghề', '', 0, 'Hệ thống ươm tạo: tạo môi trường kết nối giữa các chuyên gia khoa học- công nghệ với doanh nghiệp, làng nghề, giúp các hộ nghề, doanh nghiệp trong làng nghề truyền thống Việt Nam được tiếp cận với các kỹ thuật, phương pháp mới trong sản xuất, kinh doanh,... để tăng năng suất và lợi nhuận.', '', NULL, NULL, NULL, 'f2ee7e73cb2e436ea12f31d86626fe43', '001f823cce85434abbc4c1beac995f30', NULL, 'f2ee7e73cb2e436ea12f31d86626fe43', NULL, NULL, NULL, '2017-10-24 03:12:35', '0000-00-00 00:00:00', 3),
