('cc665be8d0ae421a921639ac8ad281fc', '94e66edf14074de88b995f878ccd633f', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Ứng dụng Microsoft Cognitive Services trong hỗ trợ dạy và học', '', 0, 'Nghiên cứu các ứng dụng của Microsoft Cognitive Services và sử dụng các API trong việc hỗ trợ giảng dạy và học tập ở trường học', '', NULL, NULL, NULL, '928a95032edc422db1985d70c6eed91a', '1fe71f2e657e470b8d4666e71ba9fdb9', NULL, '928a95032edc422db1985d70c6eed91a', NULL, NULL, NULL, '2017-10-24 03:12:34', '0000-00-00 00:00:00', 3),
('ccbf17fca0394876b7573bcfb77773fe', '570ab424735e4f40aafa3fd50e60f651', '359070d50a3f4201be26fbba6e7cdba5', 1, 888, 'Nghiên cứu các yếu tố chính ảnh hưởng đến dung lượng mạng MANETs', '', 0, 'Nghiên cứu các yếu tố chính ảnh hưởng đến dung lượng mạng MANETs(Mobile Ad hoc Network). Mạng MANET (Mobile Ad hoc Network) là một công nghệ hứa hẹn của mạng\nkhông dây di động tương lai với việc loại bỏ sự phụ thuộc vào cơ sở mạng cố định,\ngiúp việc triển khai nhanh, linh động cao và chi phí hoạt động thấp.', 'MANET', NULL, NULL, NULL, '188717cfb796430fbc7f058bd8d32a66', NULL, NULL, '188717cfb796430fbc7f058bd8d32a66', '2017-08-07 00:00:00', '2017-12-20 09:27:26', '2017-12-20 09:27:26', '2017-05-08 04:49:27', '0000-00-00 00:00:00', 2),
