('ceca2caf2a0b4bac82c0489b2678c5d1', 'd24a910e94f14940bc8f5f90f5ac38e5', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Xây dựng công cụ hỗ trợ quản lý và đảm bảo chất lượng cho các phiên bản phần mềm', '', 0, 'Hiện nay, trong quá trình phát triển, nâng cấp và bảo trì phần mềm sẽ tạo ra nhiều phiên bản khác nhau. Khóa luận này sẽ đề xuất một giải pháp và công cụ đi kèm để quản lý và đảm bảo chất lượng cho các phiên bản này.', '', NULL, NULL, NULL, '8d2754fe281648619a6b02d5327fb4d4', NULL, NULL, '8d2754fe281648619a6b02d5327fb4d4', NULL, NULL, NULL, '2017-10-24 03:12:34', '0000-00-00 00:00:00', 3),
