('d1bf2835f901424c88985345c2ec19de', 'b915b18530da4df1876709281b83224c', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'PAC-CI: Một framework hỗ trợ CI/CD', '', 0, 'PAC-CI là một framework cho phép thực hiện CI/CD theo thuật ngữ \"Pipeline as Code\" được định nghĩa bởi Jenkins, khắc phục những hạn chế về việc khó sửa đổi và tùy chỉnh cho những task phức tạp của những CI/CD framework khác. PAC-CI sử dụng Javascript (chạy trên Node.js) làm ngôn ngữ cho kịch bản (Pipeline script), tận dụng sức mạnh của Node Package Manager (npm) làm ưu điểm chính để vượt trội hơn ngôn ngữ Groovy trên Jenkins .', 'CI/CD DevOps', NULL, NULL, NULL, '5c1c0e63dcea48c9b0e7b5bf4eb2d9e5', NULL, NULL, '5c1c0e63dcea48c9b0e7b5bf4eb2d9e5', NULL, NULL, NULL, '2017-10-24 03:12:35', '0000-00-00 00:00:00', 3),
