('d82594017b414b3f902fb0bdf370b493', '6c0ac5ba938b4981967783edf83757a8', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 103, 'XÂY DỰNG ỨNG DỤNG ĐỒNG BỘ NỘI DUNG CHO CÁC SÀN THƯƠNG MẠI ĐIỆN TỬ SỬ DỤNG CÔNG NGHỆ WEB AUTOMATION SELENIUM', '', 0, 'Hiện nay, các nhà bán lẻ thường phải tốn nhiều thời gian cho việc đồng bộ, sửa đổi dữ liệu khi có thay đổi về nội dung của sản phẩm như tên, số lượng sản phẩm,... do họ bán sản phẩm trên nhiều sàn thương mại điện tử khác nhau.\nỨng dụng cho phép đồng bộ dữ liệu sản phẩm ở các sàn thương mại điện tử mà nhà bán lẻ sử dụng chỉ với một lần sửa đổi dữ liệu duy nhất giúp thông tin sản phẩm được cập nhật nhanh chóng, chính xác tới khách hàng.', '', NULL, NULL, NULL, '6d329af6b6d74839a6d8fce569346bd7', NULL, NULL, '6d329af6b6d74839a6d8fce569346bd7', NULL, NULL, NULL, '2017-10-24 03:12:37', '0000-00-00 00:00:00', 3),
('da889b7f12574efd8cabaee5b8f2656a', '2831bbe4f7124761a88eb659cc0bbeb3', '635c095a54624491977e3755da3934fb', 1, 103, 'Cải thiện thời gian chạy của bài toán slitherlink bằng SAT encoding', '', 0, 'Bài toán slitherlink là vẽ các đường đi qua các ô có đánh số sao cho số các đường đi qua một ô bằng số ô, không rẽ nhánh và tạo thành một chu trình duy nhất. Chủ đề tập trung vào cải thiện thời gian chạy của việc xác định một chu trình trong bài toán slitherlink, thực nghiệm và đánh giá thời gian chạy với các bài toán slitherlink có kích thước lớn.', '', NULL, NULL, NULL, '2828d360ca134f62ad35cf1e89088534', 'de4d21f072554fddb18513c630b98425', NULL, '2828d360ca134f62ad35cf1e89088534', NULL, NULL, NULL, '2017-10-24 03:12:34', '0000-00-00 00:00:00', 3),
