('e337b756905b4bf3a2171e61a26a8734', '7d82b133d2674162b3db46ae35bb2cf6', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 888, 'Mã hóa luồng dữ liệu đa phương tiện trên các nền tảng nhúng sử dụng PJSIP Application Framework và OpenSSL.', 'Multimedia stream encryption with PJSIP Application Framework and OpenSSL on Embedded platforms.', 0, 'Kết hợp hai bộ thư viện PJSIP Application Framework và OpenSSL để mã hóa luồng dữ liệu đa phương tiện và truyền tải trên các nền tảng nhúng.', 'luồng, mã hóa, đa phương tiện, PJSIP, OpenSSL, nền tảng nhúng', NULL, NULL, NULL, '7c3955967abb44c4b7ed3136aeb8293b', NULL, NULL, '7c3955967abb44c4b7ed3136aeb8293b', '2017-08-07 00:00:00', '2017-12-20 09:27:26', '2017-12-20 09:27:26', '2017-05-08 04:49:27', '0000-00-00 00:00:00', 2),
('e638f96f4221479988e43293d85db0d2', '24ef21af0f0e4f7f86a7b20a71852936', 'baee3b743d9f4581b015aa3b202f3eae', 1, 103, 'Ứng dụng ma trận và ten-xơ nhân tử trong tư vấn xã hội', '', 0, 'Ngày nay có nhiều loại thông tin trên internet, và sự giúp sức của các công cụ tìm kiếm thông tin, nên người ta dễ dàng tìm kiếm thông tin mà mình cần. Mặt khác do có quá nhiều thông tin nên gây không ít khó khăn cho việc định hướng chọn lựa hoặc ra quyết định từ phía người sử dụng các thông tin trên. Các hệ tư vấn đã ra đời để hỗ trợ cho người dùng trong các lựa chọn hoặc ra quyêt định\nCó nhiều hướng tiêp cận để xây dựng một hệ tư vấn, tùy thuộc vào nguồn thông tin, nhu cầu thực tế, ... mà mỗi hệ tư vấn có một phương pháp và thuật toán phù hợp. Ứng dụng ma trận và ten-xơ nhân tử là một trong sô các kỹ thuật được sử dụng. Kỹ thuật này được đánh giá cao nhờ khả năng cải tiến độ chính xác của thuât toán, tính linh hoạt và thời gian thực thi thấp,....', '', NULL, NULL, NULL, '77de2c69fca4437490cd433b846eeffe', NULL, NULL, '77de2c69fca4437490cd433b846eeffe', NULL, NULL, NULL, '2017-10-24 03:12:40', '0000-00-00 00:00:00', 3),
('e839f274ad50462dbf3a04481ea38b37', '897c2da204f0405082be79b955b6ea43', '35575f3e63f24b1298c2709a1d46abfd', 1, 103, 'Phát triển giải thuật lập lịch trên nền tảng ROS cho robot di động', 'Develop a path planning algorithm for ROS-based mobile robot', 1, 'Dựa trên một robot di động sử dụng nền tảng ROS, được trang bị Kit NVIDIA TX2 và cảm biến ảnh RGB-D, cảm biến gia tốc, một giải thuật lập lịch được phát triển và tích hợp vào hệ điều hành. Giải thuật này sử dụng thông tin về vị trí thông qua cảm biến gia tốc, thông tin về vật cản 3D thông qua cảm biến RGB-D. Giải thuật được đánh giá thông qua một hệ camera giám sát độc lập.\n\nBased on a ROS-based mobile robot, equipped with one Kit NVIDIA TX2, one RGB-D camera and one accelerometer sensor, a path planning algorithm is developed and integrated into the operating system. Location is estimated by observing the accelerometer sensor and obstacles\' information is retrieved by the RGB-D camera. The algorithm is evaluated by an independent camera system.', 'Path planning, Mobile robot, ROS, RGB-D', NULL, NULL, NULL, '827065e3080a4077a7bf3e29da4920d5', '2721cbe23b8e42c596a389d0e18ff8eb', NULL, '827065e3080a4077a7bf3e29da4920d5', NULL, NULL, NULL, '2017-10-24 03:12:33', '0000-00-00 00:00:00', 3),
('e8954946faaa42b7982ceebbd90680b4', '37d2632f41ed4abe9c1602c854571d5d', 'e73123fc886e4583bd535843b19aeb3f', 1, 103, 'Nghiên cứu kiểm thử tải ứng dụng web', '', 0, '- Nghiên cứu các nguyên tắc kiểm thử tải ứng dụng web\n- Nghiên cứu công cụ kiểm thử tải JMeter\n- Ứng dụng trong việc kiểm thử tải ứng dụng tại công ty NTT Data Việt Nam', '', NULL, NULL, NULL, 'f359d785ce704c30bb7f35eba8354c24', NULL, NULL, 'f359d785ce704c30bb7f35eba8354c24', NULL, NULL, NULL, '2017-10-24 03:12:40', '0000-00-00 00:00:00', 3),
('e9bb5bdaac3943b1a57ed64751bcb22c', '6f8aaf34f8484702b793242633deccc5', '6c35b36d0ed84ea48476d6b0a03d4fa0', 1, 103, 'Dự đoán tương tác protein-protein sử dụng mạng nơ ron tích chập', 'Protein-protein interaction prediction using Convolutional Neural Network', 1, 'Protein-protein interactions (PPIs) play a vital role in understanding biological cellular functions.Therefore, detecting PPIs will bring great impacts to the studying of many fields, including not biology itself only, but also pharmacology and health science. However, doing experiments for PPIs detecting is considered to be both time-consuming and expensive. With the purpose of building such a technique which can provide a decent prediction for PPIs, my work here focuses on using Deep Learning for prediction to reduce the number of experiments need to be done for identifying PPIs.', 'Tin sinh học, Học máy', NULL, NULL, NULL, '3470f24e13a34279918a11adc57b46af', NULL, NULL, '3470f24e13a34279918a11adc57b46af', NULL, NULL, NULL, '2017-10-24 03:12:33', '0000-00-00 00:00:00', 3),
('ec5659ce57c440bd89a675dd7e024a20', '6b6cd6467bdb4a0dafc73099d3f205ef', 'f325ef87ee92442bb17353d9fdf6124a', 1, 103, 'Phân cụm bài báo khoa học dựa trên trích dẫn', 'Citation-based clustering of scientific publications', 1, 'Phân cụm là một bài toán quan trọng trong việc nghiên cứu thống kê các bài báo khoa học cũng như góp phần định hình nghiên cứu. Việc phân cụm dựa trên trích dẫn không chỉ cho ta thấy mối liên hệ giữa các tài liệu khoa học với nhau mà còn giúp ta hình dung xu hướng nghiên cứu khoa học từ đó có cái nhìn và đánh tốt hơn về nó.', 'Text-mining, Topic clustering, Citation analysis', NULL, NULL, NULL, '7eebd6ce7e1c470abd7000147f8ebe55', NULL, NULL, '7eebd6ce7e1c470abd7000147f8ebe55', NULL, NULL, NULL, '2017-10-24 03:12:32', '0000-00-00 00:00:00', 3),
