('f28006323f0d42ac81f1a2bb01c8e1aa', 'ad5be6e617ca405c89f65ab22db7b111', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Nghiên cứu giải pháp và xây dựng công cụ kiểm thử giao diện cho các ứng dụng trên nền tảng Windows', '', 0, 'Nghiên cứu đề xuất giải pháp và đồng thời xây dựng công cụ hỗ trợ kiểm thử giao diện cho các ứng dụng trên nền tảng Windows, trong đó tập trung vào 2 loại ứng dụng là Windows Form Application và Windows Presentation Foundation.', 'Công nghệ phần mềm', NULL, NULL, NULL, '8d2754fe281648619a6b02d5327fb4d4', NULL, NULL, '8d2754fe281648619a6b02d5327fb4d4', NULL, NULL, NULL, '2017-10-24 03:12:34', '0000-00-00 00:00:00', 3),
('f2e6a98410c547ed8af38edd65a36cfa', '87c7e26a72804c24b082e33b6c3a4a2c', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Phát triển công cụ kiểm thử tự động cho chuyển đổi mô hình RTL', 'Developing an automated testing tool for the RTL transformation language', 1, 'Developing a tool that supports the automation of model transformation testing. The tool will follow the approach of black-box testing with input models and oracle function generated from the specification.', '', NULL, NULL, NULL, '25e2711f30fa4e3c99436703bac2b694', '2ae034a7ad23492e877554aeb365b22d', NULL, '25e2711f30fa4e3c99436703bac2b694', NULL, NULL, NULL, '2017-10-24 03:12:33', '0000-00-00 00:00:00', 3),
