('f537548d4318440e8f125c7ccae1f693', 'b91fb2f152a944a1ad8d0495e820e4b0', '111dea010c004383aeec7c2e1e47350f', 2, 888, 'Nghiên cứu và vận dụng kỹ thuật hướng mô hình cho đặc tả và kiểm chứng chính sách bảo mật', '', 0, 'Nghiên cứu và vận dụng kỹ thuật hướng mô hình cho đặc tả và kiểm chứng chính sách bảo mật', '', NULL, '/uploads/dangki/luanvan/2017/nguyen_duc_hieu.pdf', NULL, '25e2711f30fa4e3c99436703bac2b694', NULL, NULL, '25e2711f30fa4e3c99436703bac2b694', '2017-06-16 10:43:18', '2019-11-18 10:43:18', '2019-11-18 10:43:18', '2017-09-15 09:54:14', '0000-00-00 00:00:00', 1),
('f59984da79344112a3c7ee5ec6009229', '4f76654817e146f48538e41daae8f3dd', '111dea010c004383aeec7c2e1e47350f', 1, 103, 'Phân tích, thiết kế và xây dựng phần mềm quản lý và bán vé xe trực tuyến', '', 0, 'Hiện nay, nhu cầu di chuyển, đi lại của người dân trong những vùng đô thị rất cao, cùng với vận chuyển hàng hóa cũng có nhu cầu rất lớn đối với những người kinh doanh, buôn bán. Để giải quyết vấn đề, hệ thống đặt vé được xây dựng để phục vụ nhu cầu di chuyển, đi lại và vận chuyển hàng hóa tại các thành phố lớn hiện nay và thậm chí phát triển tới các thành phố trên toàn quốc với mục tiêu đáp ứng nhu cầu của mọi người dân, người kinh doanh. Hệ thống được xây dựng gồm nhiều phân hệ và mô-đun, nhằm mục đích phân hóa tính năng của hệ thống, cũng như phân chia hệ thống thành các phần cụ thể riêng biệt. Phân tích, thiết kế và xây dựng phần mềm quản lý và bán vé xe trực tuyến sẽ đáp ứng những nhu cầu cần thiết đó.', '', NULL, NULL, NULL, '0cb2b903a4fa4e3aa2af8789284bb889', '37a549a3f29b4515b5529e24f8d08b24', NULL, '0cb2b903a4fa4e3aa2af8789284bb889', NULL, NULL, NULL, '2017-10-24 03:12:37', '0000-00-00 00:00:00', 3),
('f5c9fdf22e3d4fde91856e8e87eda4c4', '07e7053cb68f4ede86d19de3e6325492', '635c095a54624491977e3755da3934fb', 1, 100, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-10-24 03:12:39', '0000-00-00 00:00:00', 3),
('f7992181f3cb49b6a7e07cd2569deac8', 'f016a1a9484847efba0f2db37f2d61f5', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 103, 'Web Nhiếp Ảnh', '', 0, 'Web sẽ giúp các nhiếp ảnh gia hay đơn giản là những ai thích chụp ảnh có thể up và chia sẻ ảnh. Trên đó mọi người có thể comment đánh giá, bàn luận có xếp hạng top ảnh.\nNgoài ra thêm các mục để chia sẻ kinh nghiệm, thông tin liên quan ....', '', NULL, NULL, NULL, '5a6ab1dc47cf48f49f80316f697873ee', NULL, NULL, '5a6ab1dc47cf48f49f80316f697873ee', NULL, NULL, NULL, '2017-10-24 03:12:36', '0000-00-00 00:00:00', 3),
('f7e53ba82982454c8d18857374867de8', '618c4936d07448429b4377c9b5198c0b', 'f325ef87ee92442bb17353d9fdf6124a', 1, 888, 'Human motion style learning with deep learning', 'Human motion style learning with deep learning', 1, 'Human motion style learning with deep learning', '', NULL, NULL, NULL, 'b2c4a0310ca8433f8471425cc50fa9fe', '51517f1558da4f8a814add78bf40da26', NULL, 'b2c4a0310ca8433f8471425cc50fa9fe', '2017-09-11 14:34:23', '2017-12-20 14:34:23', '2017-12-20 14:34:23', '2017-09-15 03:04:40', '0000-00-00 00:00:00', 2),
('fb15a94920d04c83b44bfa79db1a748b', '677aeed626f84fe1b064a7bdde83750c', 'bebe3f425eb0467586f34834ad4bd17c', 2, 888, 'Phương pháp nhận dạng khuôn mặt người và ứng dụng trong quản lý nhân sự', '', 0, 'Phương pháp nhận dạng khuôn mặt người và ứng dụng trong quản lý nhân sự', '', NULL, '/uploads/dangki/luanvan/2017/nguyen_thi_thuy.pdf', NULL, 'ab16d5f753f24b01bb9abc2089436c63', NULL, NULL, 'ab16d5f753f24b01bb9abc2089436c63', '2017-06-16 10:44:47', '2019-11-18 10:44:47', '2019-11-18 10:44:47', '2017-09-15 09:54:14', '0000-00-00 00:00:00', 1),
('fb9923a39e4e490f800c9a2d581f7372', '8d8634ead097425dbdd889b447fbb000', 'baee3b743d9f4581b015aa3b202f3eae', 1, 103, 'Phát hiện ý định trong các truy vấn tìm kiếm thương mại điện tử tiếng Việt', 'Intention Discovery from Vietnamese E-Commerce Search Queries', 1, 'Với sự bùng nổ của thương mại điện tử ở Việt Nam, người tiêu dùng đang dần chuyển hướng từ mua bán truyền thống sang mua bán online. Các website thương mại điện tử đã và đang được tích hợp các công cụ tìm kiếm thông minh để giúp người tiêu dùng tìm được sản phẩm như mong muốn. Khóa luận sẽ tập trung vào việc tìm ra ý định của người tiêu dùng trong các truy vấn tìm kiếm thương mại điện tử tiếng Việt, ví dụ như ý định mua hàng; ý định tìm kiếm sản phẩm theo giá cả, chủng loại... Các kĩ thuật học máy và khai phá dữ liệu sẽ được nghiên cứu và áp dụng để tìm ra giải pháp cho bài toán nêu trên.', '', NULL, NULL, NULL, '2721cbe23b8e42c596a389d0e18ff8eb', '0b99655b95ae4adf9e3ec9203542edd9', NULL, '2721cbe23b8e42c596a389d0e18ff8eb', NULL, NULL, NULL, '2017-10-24 03:12:33', '0000-00-00 00:00:00', 3),
('fc18556d9c4d47648e53861299cd91a8', '3c7ea7837bec44bea33f8949201d030f', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 103, 'Bài toán lập lịch và tối ưu hóa tài nguyên', '', 0, 'Tìm hiểu thuật toán tham lam và áp dụng cài đặt bài toán lập lịch dựa trên Nodejs framework', '', NULL, NULL, NULL, '6d329af6b6d74839a6d8fce569346bd7', '7c3955967abb44c4b7ed3136aeb8293b', NULL, '6d329af6b6d74839a6d8fce569346bd7', NULL, NULL, NULL, '2017-10-24 03:12:38', '0000-00-00 00:00:00', 3),
