('fd110a42fa314f79846fc32d6cb77c23', 'a4501cd8096c48ef9d1c3c1c1e9ae841', '7c4d87122f8f4fc5b17db4708cbe0039', 1, 103, 'Nhận diện hàng hóa cho robot Fetch trong nhà kho', '', 0, 'Sử dụng môi trường giả lập Gazebo kết nối với ROS để điều khiển robot thông qua một số thuật toán Machine Learning để nhận diện hàng hóa trong môi trường đó.', 'Machine Learning', NULL, NULL, NULL, '3797863ff648440b9f27c3229ccda974', 'ac1973c3ace54568a6b3defef1a47211', NULL, '3797863ff648440b9f27c3229ccda974', NULL, NULL, NULL, '2017-10-24 03:12:36', '0000-00-00 00:00:00', 3),
('fd17944133e6433ebefb0b7ce2de73ab', 'f1290425f69f4aaea110af3652b81796', 'ee19a8616e6a468f8f727fb5be89f20b', 2, 888, 'Giảm kích cỡ đặc trưng trong phát hiện tấn công Web dựa vào bất thường', '', 0, 'Giảm kích cỡ đặc trưng trong phát hiện tấn công Web dựa vào bất thường', '', NULL, '/uploads/dangki/luanvan/2017/le_thanh_binh.pdf', NULL, '0f32b72630d848e2b22135e2eb11c25f', NULL, NULL, '0f32b72630d848e2b22135e2eb11c25f', '2017-06-16 10:44:47', '2019-11-18 10:44:47', '2019-11-18 10:44:47', '2017-09-15 09:54:13', '0000-00-00 00:00:00', 1),
('fd2eaf2a3db541519bcd872cf40848a6', '517b3761dc2746a2b60bd41f8b2fe453', 'ee19a8616e6a468f8f727fb5be89f20b', 1, 888, 'Hệ thống quản lý hỗ trợ sinh viên tham gia thực tập chuyên ngành', '', 0, 'Một trong những hoạt động hợp tác đào tạo với doanh nghiệp quan trọng của Khoa là hoạt\n\nđộng gửi sinh viên đến thực tập chuyên ngành tại các doanh nghiệp. Sinh viên của khoa CNTT\n\nđều có một kỳ thực tập tại doanh nghiệp trước khi tốt nghiệp. Kỳ thực tập này được lấy điểm\n\nnhư một môn học 3 tín chỉ trong khung chương trình đào tạo. Khi đến kỳ thực tập, sinh viên lựa\n\nchọn các doanh nghiệp là đối tác của Khoa để thực tập. Mỗi sinh viên sẽ có một giảng viên\n\nhướng dẫn trong suốt quá trình thực tập. Sinh viên khi đi thực tập cần phải cập nhật thường\n\nxuyên tiến độ thực tập và phải đáp ứng được các thời hạn nộp báo cáo cho giảng viên hướng\n\ndẫn. Cuối mỗi kỳ thực tập, sinh viên nhận được các đánh giá từ phía doanh nghiệp và giảng viên\n\nhướng dẫn. Đây là căn cứ quan trọng để tính điểm cho kỳ thực tập và đồng thời là thông tin\n\nquan trọng để đánh giá năng lực tổng thể của sinh viên. Khoa sẽ tổng hợp điểm và xây dựng các\n\nbáo cáo, thống kê cần thiết khác phục vụ cho quản lý.\n\nCác sinh viên và cựu sinh viên là nguồn lực quan trọng nhất của Khoa mà các doanh nghiệp\n\nsử dụng nhân lực CNTT quan tâm. Các doanh nghiệp muốn tiếp cần thông tin về nguồn nhân lực\n\nnày, đồng thời, các sinh viên và cựu sinh viên cũng cần có một kênh chính thức tập trung (thông\n\nqua Khoa) để tìm kiếm cơ hội thực tập và làm việc. Chính vì vậy, việc quản lý thông tin về quá\n\ntrình đào tạo chuyên môn và năng lực của các sinh viên trở thành một vấn đề bức thiết của\n\nKhoa.\n\nKhoa CNTT hiện nay chưa có một hệ thống phần mềm đầy đủ và thống nhất cho việc quản lý\n\ncác công việc liên quan đến doanh nghiệp đối tác, thực tập cũng như quản lý chuyên môn của\n\ncác sinh viên và cựu sinh viên. Hệ thông Quản lý nguồn nhân lực đáp ứng được nhu cầu trên\n\ncủa Khoa CNTT.', 'Lập trình', NULL, NULL, NULL, 'f2ee7e73cb2e436ea12f31d86626fe43', NULL, NULL, 'f2ee7e73cb2e436ea12f31d86626fe43', '2017-08-07 00:00:00', '2017-12-20 09:27:26', '2017-12-20 09:27:26', '2017-05-08 04:49:27', '0000-00-00 00:00:00', 2),
