(1, '341ea2645f3b49fcb02f6b559ed9c5e3', 1326, 'Phân tích cảm xúc người dùng trên website thương mại', NULL, NULL, 'Xây dựng hệ thống phân tích cảm xúc người dùng dựa trên nội dụng như bình luận, biểu tượng, bài đăng... trên các trang mạng xã hội nổi tiếng như Facebook, twitter', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-10 03:16:06', '0000-00-00 00:00:00'),
