(3, '84f00bd045b14c2dae5b7dcfa6d0e127', 1328, 'Xây dựng hệ thống gia sư thông minh', NULL, NULL, 'Hệ thống giúp kết nối dễ dàng giữa gia sư và học sinh. Tạo điều kiện cho học sinh có thể học với gia sư bất kỳ lúc nào rảnh và học với bất kỳ gia sư nào cũng rảnh dỗi thời gian đó mà vẫn đúng môn học và bài học. Không bó buộc phải học với một gia sư nào từ đầu tới cuối khóa học.', 'Gia sư thông minh', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-10 03:16:06', '0000-00-00 00:00:00'),
(4, '1bb002b4b224416f96e5b662cfd4a6cf', 1329, 'Cài đặt và đánh giá hệ thống phân tích dữ liệu nhật ký', NULL, NULL, '- Cài đặt và đánh giá hệ thống xử lý, phân tích dữ liệu nhật ký (log) bằng giải pháp ELK (Elasticsearch, Logstash, Kibana) trên hê điều hành nhân Linux. (Ubuntu, CentOS)\n- Tích hợp thêm giải pháp Kafka -Zookeeper để xử lý tiếp nhận dữ liệu lớn từ nhiều nguồn', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-10 03:16:06', '0000-00-00 00:00:00'),
(5, 'ddce3ea2798946c0b8fe333870f6b425', 1330, 'Nghiên cứu và xây dựng mobile application với scale lớn & serverless sử dụng Cloud technology', NULL, NULL, '- Đề tài kết hợp với bên Fsoft vừa được thực tập, vừa làm đồ án.\n- Nghiên cứu các cloud services: AWS Lambda, S3, API Gateway, DynamoDB\n- Nghiên cứu mô hình thiết kế frontend – backend cho mobile application\n- Xây dựng giải pháp sử dụng các cloud services theo hướng serverless\n- Xây dựng ứng dụng demo', 'cloud, mobile', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-10 03:16:06', '0000-00-00 00:00:00'),
