(9, '31a72010d1e0477ab69f7b0581c0f97e', 1334, 'Lập trình ứng dụng tích điểm bằng meteor full stack', NULL, NULL, 'Meteor là một nền tảng JavaScript đầy đủ để phát triển các ứng dụng web và di động hiện đại. Meteor bao gồm một bộ công nghệ chính để xây dựng các ứng dụng của khách hàng kết nối, một công cụ xây dựng và tập hợp các gói từ Node.js và cộng đồng JavaScript nói chung.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-10 03:16:07', '0000-00-00 00:00:00'),
